This class is a custom `LayerDrawable` in Android that stacks multiple drawables (icons) on top of each other, with the first two icons being reversed. The `onBoundsChange` method is overridden to adjust the position and size of the icons when the bounds of the drawable change.

In Swift, you can create a similar class using `CALayer` and `CAShapeLayer` for the drawables. Here's a basic example:

```swift
import UIKit

class StackedLayers: CAStackLayer {
    private var shouldPlaceIcons = true
    private var iconScale: CGFloat = 0.7

    init(layers: [CALayer], iconScale: CGFloat = 0.7) {
        super.init()
        self.iconScale = iconScale
        self.contentsScale = UIScreen.main.scale
        self.layers = layers
        self.shouldPlaceIcons = true
    }

    override func layoutSublayers() {
        super.layoutSublayers()
        if shouldPlaceIcons {
            placeIcons()
            shouldPlaceIcons = false
        }
    }

    private func placeIcons() {
        shouldPlaceIcons = true
        let bounds = bounds
        let iconsSize = floor(bounds.width * iconScale)
        let iconsInset = bounds.width - iconsSize - 1

        for (index, layer) in layers.enumerated() {
            layer.frame = CGRect(x: 0, y: 0, width: iconsSize, height: iconsSize)
            layer.position = CGPoint(x: bounds.midX, y: bounds.midY)

            switch index {
            case 1:
                layer.frame.origin = CGPoint(x: iconsInset, y: iconsInset)
            case 0:
                layer.frame.origin = CGPoint(x: iconsInset, y: 0)
            default:
                break
            }
        }
    }
}
```

This Swift class creates a `CAStackLayer` with multiple `CALayer`s as its sublayers. The `layoutSublayers` method is overridden to adjust the position and size of the icons when the bounds of the layer change. The `placeIcons` method is similar to the Android version, adjusting the position and size of the icons

