        user_answer = input(f"What is {num1} {operation} {num2}? ")

        if user_answer.lower() == 'quit':
            print(f"Your final score is: {score}")
            break

        try:
            user_answer = int(user_answer)
            if user_answer == answer:
                print("Correct!")
                score += 1
            else:
                print(f"Incorrect! The correct answer is {answer}")
        except ValueError:
