                // If the password is correct, send the GTMP? message and read the temperature.
                if (responseData.Contains("Password correct"))
                {
                    sendBuffer = Encoding.ASCII.GetBytes("GTMP?");
                    stream.Write(sendBuffer, 0, sendBuffer.Length);

                    receiveBuffer = new byte[1024];
                    bytesRead = stream.Read(receiveBuffer, 0, receiveBuffer.Length);
                    responseData = Encoding.ASCII.GetString(receiveBuffer, 0, bytesRead);

                    Console.WriteLine($"Temperature: {responseData}");
                }

                // Send the LOGOUT message to close the connection.
                sendBuffer = Encoding.ASCII.GetBytes("LOGOUT");
                stream.Write(sendBuffer, 0, sendBuffer.Length);

                // Close everything.
                stream.Close();
                client.Close();
            }
            catch (Exception e)
            {
                Console.WriteLine("Error: " + e);
            }

            Console.ReadLine();
        }
    }
}
