function mergeArrays(arr1, arr2) {
  const set = new Set();

  // Iterate through both arrays and add unique objects to the set
  const mergedArray = [...arr1, ...arr2].reduce((acc, obj) => {
    const key = JSON.stringify([obj.stepId, obj.fieldId]);

    // If the object is not already in the set, add it
    if (!set.has(key)) {
      set.add(key);
      acc.push(obj);
    }

    return acc;
  }, []);

  // Merge message properties from the first object if not available in the second object
  mergedArray.forEach(obj => {
    if (!arr2.some(otherObj => otherObj.stepId === obj.stepId && otherObj.fieldId === obj.fieldId)) {
      // If the message property is not present in the first object, set it to an empty string
      if (!obj.message) obj.message = '';
    } else {
      // If the message property is present in the second object, use it
      const otherObjIndex = arr2.findIndex(otherObj => otherObj.stepId === obj.stepId && otherObj.fieldId === obj.fieldId);
      obj.message = arr2[otherObjIndex].message || obj.message;
    }
  });

  return mergedArray;
}

