3. Implement the CSV downloader service:

```javascript
import Service from '@ember/service';
import { get } from '@ember/object';
import { inject as service } from '@ember/service';
import { A } from '@ember/array';
import { read } from 'csv-parser';
import { createReadStream } from 'fs';
import { promisify } from 'util';

const readFile = promisify(createReadStream);

export default Service.extend({
  store: service(),

  async downloadCSV(url) {
    const worker = new Worker('/assets/csv-downloader.js');

    worker.onmessage = (event) => {
      const records = event.data.map((record) => {
        return this.store.createRecord('csv-record', record);
      });

      this.store.pushPayload({
        data: {
          type: 'csv-records',
          records,
        },
      });
    };

    worker.postMessage({ url });
  },
});
```

