```

Then, create a script (e.g., `compareExcel.js`) to read and compare the files:

```javascript
const XLSX = require('xlsx');
const _ = require('lodash');

function compareFiles(file1, file2, sheetName) {
  const workbook1 = XLSX.readFile(file1);
  const workbook2 = XLSX.readFile(file2);

  const sheet1 = workbook1.Sheets[sheetName];
  const sheet2 = workbook2.Sheets[sheetName];

  const keys1 = _.keys(sheet1);
  const keys2 = _.keys(sheet2);

  const commonKeys = _.intersection(keys1, keys2);

  const differences = [];

  commonKeys.forEach((key) => {
    if (sheet1[key].v !== sheet2[key].v) {
      differences.push({
        key,
        file1: sheet1[key].v,
        file2: sheet2[key].v,
      });
    }
  });

  return differences;
}

// Usage
const file1 = 'file1.xlsx';
const file2 = 'file2.xlsx';
const sheetName = 'Sheet1';

const differences = compareFiles(file1, file2, sheetName);

console.log(differences);
```

This script reads the specified sheets from the provided Excel files, finds common keys, and checks if the values for those keys are the same in both files. If there are any differences, it stores them in an array and logs the array at the end.

